import React from 'react'
import './app.css'
import BorderInput from "../shared/ui/borderInput/BorderInput";
import BlueButton from "../shared/ui/blueButton/BlueButton";

const App = () => {
    return (
        <div className="app">
            <form action="">
                <BorderInput type="text" placeholder="test"></BorderInput>
                <BlueButton>test text</BlueButton>
            </form>
        </div>
    )
}

export default App
